import React from 'react';

const Home = () => {
  return (
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h1 style={{ fontSize: '3rem', color: '#00ff00', textShadow: '0 0 10px #00ff00' }}>
        Bem-vindo à Loja Monster
      </h1>
      <p style={{ color: '#ccc', marginTop: '20px' }}>
        Explore nossos produtos energéticos e faça seu pedido!
      </p>
    </div>
  );
};

export default Home;
